                        <button type="submit" className="sendButton">SEND</button>
                    </div>
                    <div className='backToLoginDiv'>
                        Back to
                        <button type="button" className='baclogin , buttonLink'>Log in</button>
                    </div>
                </div>
            </form>
        </div>
    );
}
